import React, { useState, useEffect } from 'react';
import { Container, Card } from 'react-bootstrap';
import { useParams } from 'react-router-dom';
import profileImage from '../assets/profile.jpg'; // Optional profile image

function UserProfile() {
    const { userId } = useParams(); // Retrieve user ID from the URL
    const [user, setUser] = useState(null); // State to store the fetched user data

    useEffect(() => {
        fetchUserProfile();
    }, [userId]); // Re-fetch when userId changes

    const fetchUserProfile = async () => {
        const token = localStorage.getItem('token'); // Retrieve authentication token
        try {
            const response = await fetch(`http://138.197.99.80:2490/api/users/${userId}`, {
                method: 'GET',
                headers: { Authorization: `Bearer ${token}` }
            });

            if (response.ok) {
                const data = await response.json(); // Parse response data
                setUser(data); // Set the user data
            } else {
                console.error("Failed to fetch user profile. Status:", response.status);
            }
        } catch (error) {
            console.error('Error fetching user profile:', error);
        }
    };

    if (!user) {
        return <div>Loading...</div>; // Show loading if user data is not yet fetched
    }

    return (
        <div className="min-vh-100 w-100">
            {/* User Profile Card */}
            <Container className="d-flex justify-content-center align-items-center mt-5 mb-5">
                <Card style={{ width: '28rem', paddingTop: '3rem', paddingBottom: '3rem' }}>
                    <div className="d-flex justify-content-center align-items-center">
                        <Card.Img
                            variant="top"
                            src={profileImage}
                            className="rounded-circle img-fluid"
                            style={{ height: '220px', width: '240px' }}
                        />
                    </div>
                    <Card.Body>
                        <Card.Title>{user.first_name} {user.last_name}</Card.Title>
                        <Card.Text><strong>Username:</strong> {user.user_name}</Card.Text>
                        <Card.Text><strong>Major:</strong> {user.major}</Card.Text>
                        <Card.Text><strong>Graduation Year:</strong> {user.year_graduated}</Card.Text>
                        <Card.Text><strong>Company:</strong> {user.company}</Card.Text>
                        <Card.Text><strong>Title:</strong> {user.title}</Card.Text>
                        <Card.Text><strong>Email:</strong> {user.email}</Card.Text>
                        <Card.Text>
                            <strong>LinkedIn:</strong> {user.linkedin_link ? <a href={user.linkedin_link} target="_blank" rel="noopener noreferrer">Profile</a> : "No LinkedIn provided"}
                        </Card.Text>
                    </Card.Body>
                </Card>
            </Container>
        </div>
    );
}

export default UserProfile;
